import './App.css';
import { Timeline } from './Timeline/Timeline'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          src={"https://images.spaceappschallenge.org/images/XZHPysZTUCA9gBWH1MHIH2yRGJg"}
          className="App-logo"
          alt="logo"
        />
      </header>
      <Timeline />
    </div>
  );
}

export default App;
